import React from "react";
import Link from "next/link";

const Navbar = () => {
  return (
    <header id="main-navbar">
      <h1 id="title">Kronikea</h1>
      <nav className="main-nav">
        <ul>
          <li className="active">
            <Link href="/">
              <a>Home</a>
            </Link>
          </li>
          <li>
            <Link>
              <a>Profile</a>
            </Link>
          </li>
          <li>Stories</li>
          <li>Characters</li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
